import React from 'react'

export default function RequestRide() {
  return (
    <div className={'mainContainer'}>
      <div className={'inputContainer'}>
        <p>Enter starting address:</p>
        <input
          className={'inputBox'}
        />
      </div>
      <div className={'inputContainer'}>
        <p>Enter ending address:</p>
        <input
          className={'inputBox'}
        />
      </div>
    </div>
  )
}
